import{_ as e,c as a,o as l,a5 as t}from"./chunks/framework.TR9kNvsR.js";const w=JSON.parse('{"title":"Wallet Self-help","description":"","frontmatter":{},"headers":[],"relativePath":"learn/wallet/wallet-self-help.md","filePath":"learn/wallet/wallet-self-help.md","lastUpdated":null}'),i={name:"learn/wallet/wallet-self-help.md"},o=t('<h1 id="wallet-self-help" tabindex="-1">Wallet Self-help <a class="header-anchor" href="#wallet-self-help" aria-label="Permalink to &quot;Wallet Self-help&quot;">​</a></h1><p>If you find you can&#39;t access your wallet, stay calm. Check what information you still have available, such as your password, files, and seed. Don&#39;t clear your browser cache.</p><h2 id="make-sure-you-have-the-following-information-and-files" tabindex="-1">Make sure you have the following information and files. <a class="header-anchor" href="#make-sure-you-have-the-following-information-and-files" aria-label="Permalink to &quot;Make sure you have the following information and files.&quot;">​</a></h2><ul><li><p><strong>Address 55-char seed</strong></p></li><li><p><strong>Wallet password</strong></p></li><li><p><strong>File</strong></p><p>Vault file</p><p>or</p><p>qubic.li-wallet.config and qubic.li-wallet.unlock</p><p>or older</p><p>qubic.li-wallet.config and qubic.li-wallet.privatekey</p></li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Older wallet files were made up of two parts: a configuration file and an unlock file. If you&#39;re still using this type of file, please update to the Vault file as soon as possible.</p></div><h4 id="_1-have-55-char-seed-backup" tabindex="-1">1. Have 55-char seed backup <a class="header-anchor" href="#_1-have-55-char-seed-backup" aria-label="Permalink to &quot;1. Have 55-char seed backup&quot;">​</a></h4><p>This situation most easily solves, only need to create new wallet will address import wallet can recover.</p><p>To avoid accidents, please use the browser&#39;s private tab or other browsers to create a new wallet and try it first.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This highlights the crucial need to back up 55-char seeds.</p></div><h4 id="_2-have-wallet-password-and-vault-file" tabindex="-1">2. Have Wallet password and Vault file <a class="header-anchor" href="#_2-have-wallet-password-and-vault-file" aria-label="Permalink to &quot;2. Have Wallet password and Vault file&quot;">​</a></h4><p>Vault file stores your wallet address information. To access it, simply input your password and import the file using the new Web Wallet domain name.</p><p>New domain: <a href="https://wallet.qubic.org/" target="_blank" rel="noreferrer">https://wallet.qubic.org/</a></p><p><em>Other situations: Since your wallet requires downloading a new Vault file every time you make an edit or update, if you have multiple Vault files and find the import address is incorrect, try importing a different Vault file.</em></p><h4 id="_3-have-wallet-password-and-qubic-li-wallet-config-and-qubic-li-wallet-unlock-qubic-li-wallet-privatekey" tabindex="-1">3. Have Wallet password, and qubic.li-wallet.config and qubic.li-wallet.unlock/qubic.li-wallet.privatekey <a class="header-anchor" href="#_3-have-wallet-password-and-qubic-li-wallet-config-and-qubic-li-wallet-unlock-qubic-li-wallet-privatekey" aria-label="Permalink to &quot;3. Have Wallet password, and qubic.li-wallet.config and qubic.li-wallet.unlock/qubic.li-wallet.privatekey&quot;">​</a></h4><p>Similar to the previous case, the key difference is that you&#39;ll need to import two files.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>To prevent any unforeseen issues, please update your files to the Vault format as soon as possible.</p></div><h4 id="_4-high-difficulty-mode-only-possesses-wallet-password-and-qubic-li-wallet-unlock-qubic-li-wallet-privatekey" tabindex="-1">4. High difficulty mode - only possesses Wallet password and qubic.li-wallet.unlock/qubic.li-wallet.privatekey <a class="header-anchor" href="#_4-high-difficulty-mode-only-possesses-wallet-password-and-qubic-li-wallet-unlock-qubic-li-wallet-privatekey" aria-label="Permalink to &quot;4. High difficulty mode - only possesses Wallet password and qubic.li-wallet.unlock/qubic.li-wallet.privatekey&quot;">​</a></h4><p>If you accidentally deleted qubic.li-wallet.config and your browser cache is still accessible, you can still unlock your wallet using your password and importing qubic.li-wallet.unlock. If it&#39;s still working, please export your address 55-char seed and update to a Vault file as soon as possible.</p><blockquote><p><strong>Remember, always keep your important information safe and secure your own digital assets.</strong></p></blockquote>',19),s=[o];function r(n,c,u,d,p,h){return l(),a("div",null,s)}const b=e(i,[["render",r]]);export{w as __pageData,b as default};
